    [],nt"num_tags": 0,nt"name": "geosat-follow-on-gfo-precise-orbit-ephemeris-nodc-accession-0085958",nt"isopen":
    false,nt"url": null,nt"notes": "The GEOSAT Follow-On (GFO) program is the
    Navy's initiative to develop an operational series of radar altimeter satellites
    to maintain continuous ocean observation from the GEOSAT Exact Repeat Orbit. GFO
    was launched in February 1998. On 29 November 2000 the Navy accepted the satellite
    as operational. GFO officially ended on October 22, 2008. POE files are produced
    at NASA Goddard Space Flight Center (GSFC) within 3-4 weeks for use on the GFO Geophysical
    Data Record (GDR). They have an expected radial accuracy of 5 cm RMS (Root Mean
    Squared) over the six day arc.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
